alled by %1$s on %2$s. <a target="_blank" href="%3$s">More information</a>'=>'Dodatak je instalirao %1$s u %2$s. <a target="_blank" href="%3$s">Više informacija</a>','Enter an optional note attached to the order confirmation message sent to the shopper.'=>'Unesite neobaveznu bilješku priloženu poruci potvrde narudžbe poslanoj kupcu.','Post-purchase note'=>'Bilješka nakon kupnje','Custom fields can be used in a variety of ways, such as sharing more detailed product information, showing more input fields, or for internal inventory organization. %1$sRead more about custom fields%2$s'=>'Prilagođena polja mogu se koristiti na različite načine, kao što je dijeljenje detaljnijih informacija o proizvodu, prikazivanje više polja za unos ili za unutarnju organizaciju inventara. %1$sPročitajte više o prilagođenim poljima%2$s','Custom fields'=>'Dodatni podaci','Show custom fields'=>'Prikaži prilagođena polja','Use global attributes to allow shoppers to filter and search for this product. Use custom attributes to provide detailed product information.'=>'Koristite globalne atribute kako biste kupcima omogućili filtriranje i pretraživanje ovog proizvoda. Koristite prilagođene atribute za pružanje detaljnih informacija o proizvodu.','Per your %1$sstore settings%2$s, taxes are not enabled.'=>'Prema vašim %1$spostavkama trgovine%2$s, porezi nisu omogućeni.','Unable to create backup post for order %d.'=>'Nije moguće stvoriti pričuvnu objavu za narudžbu %d.','%s is not a valid order property.'=>'%s nije važeće svojstvo narudžbe.' . "\0" . '%s nisu važeća svojstva narudžbe.' . "\0" . '%s nisu važeća svojstva narudžbe.','%s is an internal meta key. Use --props to set it.'=>'%s je interni meta ključ. Koristite --props za postavljanje.' . "\0" . '%s su interni meta ključevi. Koristite --props da ih postavite.' . "\0" . '%s su interni meta ključevi. Koristite --props da ih postavite.','The backup datastore does not support updating orders.'=>'Rezervna pohrana podataka ne podržava ažuriranje naloga.','New custom field name'=>'Novi naziv prilagođenog polja','Please review the errors above.'=>'Pregledajte gore navedene pogreške.','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'Način razvoja WooCommerce Blocks zahtijeva izradu datoteka. Iz korijenskog direktorija pokrenite %1$s da biste bili sigurni da je verzija vašeg čvora usklađena, pokrenite %2$s da biste instalirali ovisnosti, %3$s da biste izradili datoteke ili %4$s da biste izradili datoteke i pratili promjene.','Overriding existing data with an already registered key is not allowed'=>'Nadjačavanje postojećih podataka s već registriranim ključem nije dopušteno','Key for the data being registered must be a string'=>'Ključ za podatke koji se registriraju mora biti niz znakova','The metaboxhidden_product meta from the user metas.'=>'Meta metaboxhidden_product iz meta korisnika.','Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Postavite svoje načine plaćanja i prihvaćajte kreditne i debitne kartice, gotovinu, bankovne prijenose i novac sa svog Mercado Pago računa. Ponudite sigurna i sigurna plaćanja s vodećim procesorom u Latinskoj Americi.','Mercado Pago'=>'Mercado Pago','Collect sales tax'=>'Naplata poreza na promet','Add your products'=>'Dodajte svoje proizvode','Get paid'=>'Primite uplatu','Grow your business'=>'Unaprijedite svoje poslovanje','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'Vrijeme je za slavlje – spremni ste za otvaranje svoje trgovine! Boriti se! Pritisnite gumb za pregled svoje trgovine i učinite je javnom.','Launch your store'=>'Pokrenite svoju trgovinu','Get your products shipped'=>'Šaljite svoje proizvode','Current price is: %s.'=>'Trenutna cijena je: %s.','Original price was: %s.'=>'Izvorna cijena bila je: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Naplata se može prilagoditi <a href="%s">u uređivaču</a> s vašom aktivnom temom.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce je pokušao instalirati <a href="%1$s">dodatak Legacy REST API</a> jer je na ovoj stranici <a href="%2$s">omogućen Legacy REST API</a> ili su <a href="%3$s">definirani naslijeđeni webhookovi</a>, ali instalacija nije uspjela (pogledajte pojedinosti o pogrešci u <a href="%4$s">zapisnicima WooCommercea</a>). Instalirajte i aktivirajte dodatak ručno. <a href="%5$s">Više informacija</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'i️ WooCommerce je instalirao i <a href="%1$s">aktivirao dodatak Legacy REST API</a> jer ova stranica ima <a href="%2$s">omogućen Legacy REST API</a> ili ima <a href="%3$s">definirane naslijeđene webhookove</a>. <a href="%4$s">Više informacija</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce je instalirao dodatak Legacy REST API, ali ga nije uspio aktivirati, pogledajte kontekst za više detalja.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce je <a href="%1$s">instalirao dodatak Legacy REST API</a> jer ova stranica ima <a href="%2$s">omogućen Legacy REST API</a> ili ima <a href="%3$s">definirane naslijeđene webhookove</a>, ali ga nije uspjela aktivirati (pogledajte pojedinosti o pogrešci u <a href="%4$s">zapisnicima WooCommercea</a>). Idite na <a href="%5$s">stranicu dodataka</a> i aktivirajte je ručno. <a href="%6$s">Više informacija</a>','Please enter a valid email at checkout to use coupon code "%s".'=>'Unesite valjanu e-poštu na blagajni kako biste koristili kod kupona "%s".','Please enter a valid email to use coupon code "%s".'=>'Unesite valjanu e-poštu za korištenje koda kupona "%s".','To allow logging, make %s writable.'=>'Da biste omogućili prijavu, učinite %s zapisivim.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Lokalno preuzimanje: postavite lokacije preuzimanja na <a href="%s">stranici Postavke lokalnog preuzimanja</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Istražite novi poboljšani način dostave koji vam omogućuje da korisnicima jednostavno ponudite jednu ili više lokacija preuzimanja na <a href="%s">stranici Postavke lokalnog preuzimanja</a>.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Prikupljanje podataka o korištenju omogućuje nam da prilagodimo vaše iskustvo postavljanja trgovine, ponudimo relevantniji sadržaj i pomognemo da WooCommerce učinimo boljim za sve.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'<a href="%1$s">Instalirajte WooCommerce.com Update Manager</a> da biste nastavili primati ažuriranja i pojednostavljenu podršku uključenu u vaše pretplate na WooCommerce.com. Alternativno, možete <a href="%2$s">ga preuzeti</a> i instalirati ručno.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'<a href="%1$s">Aktivirajte upravitelj ažuriranja WooCommerce.com</a> da biste nastavili primati ažuriranja i pojednostavljenu podršku uključene u vaše pretplate na WooCommerce.com.',' Activate WooCommerce.com Update Manager to update.'=>' Aktivirajte WooCommerce.com Update Manager za ažuriranje.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Instalirajte WooCommerce.com Update Manager</a> za ažuriranje.','block keywordrich-text'=>'obogaćeni tekst','block keywordtextarea'=>'textarea','block descriptionA text-area field for use in the product editor.'=>'Polje tekstnog područja za upotrebu u uređivaču proizvoda.','block titleProduct textarea block'=>'Blok tekstnog područja proizvoda','block keywordsubsection'=>'pododjeljak','block descriptionThe product subsection description.'=>'Opis pododjeljka proizvoda.','block titleProduct subsection description'=>'Opis pododjeljka proizvoda','Invalid %s provided.'=>'Nevažeći %s dostavljen.','Internal server error'=>'Interna pogreška poslužitelja','Sorry, you cannot delete resources.'=>'Nažalost, ne možete izbrisati resurse.','Sorry, you cannot create resources.'=>'Nažalost, ne možete stvoriti resurse.','Sorry, you cannot view resources.'=>'Nažalost, ne možete pregledati resurse.','True to force the creation of a new receipt even if one already exists and has not expired yet.'=>'Istina je da prisi