%7$s','There was an error getting the install URL for this product.'=>'Došlo je do pogreške pri donošenju URL-a za instalaciju ovog proizvoda.','This product is already installed.'=>'Ovaj proizvod je već instaliran.','You do not have permission to manage log entries.'=>'Nemate dozvolu za upravljanje unosima dnevnika.','Hide context'=>'Sakrij kontekst','Show context'=>'Prikaz konteksta','Context'=>'Kontekst','Additional context'=>'Dodatni kontekst','block keywordProduct Collection'=>'Kolekcija proizvoda','block descriptionThe contents of this block will display when there are no products found.'=>'Sadržaj ovog bloka prikazat će se kada nisu pronađeni proizvodi.','block titleNo results'=>'Nema rezultata','Refresh'=>'Osvježi','Subscribe'=>'Pretplatite se','This product will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'Ovaj proizvod neće pokrenuti kalkulator dostave vašeg kupca u košarici ili na blagajni. Ovaj proizvod također neće zahtijevati od vaših kupaca da unesu svoje podatke o dostavi na blagajni. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Pročitajte više o virtualnim proizvodima</a>.','This product has options, such as size or color. You can now manage each variation\'s shipping settings and other details individually.'=>'Ovaj proizvod ima opcije, kao što su veličina ili boja. Sada možete pojedinačno upravljati postavkama dostave i drugim detaljima svake varijante.','This product has options, such as size or color. You can now manage each variation\'s inventory and other details individually.'=>'Ovaj proizvod ima opcije, kao što su veličina ili boja. Sada možete pojedinačno upravljati inventarom i drugim detaljima svake varijante.','Help customers find this product by assigning it to categories, adding extra details, and managing its visibility in your store and other channels.'=>'Pomozite kupcima da pronađu ovaj proizvod tako što ćete ga dodijeliti kategorijama, dodati dodatne detalje i upravljati njegovom vidljivošću u vašoj trgovini i drugim kanalima.','Buy button text'=>'Kupi tekst gumba','Link to the external product is an invalid URL.'=>'Veza na vanjski proizvod nevažeći je URL.','Enter the external URL to the product'=>'Unesite vanjski URL proizvoda','Link to the external product'=>'Link na vanjski proizvod','Add a link and choose a label for the button linked to a product sold elsewhere.'=>'Dodajte vezu i odaberite oznaku za gumb povezan s proizvodom koji se prodaje negdje drugdje.','Buy button'=>'Gumb za kupnju','This product has options, such as size or color. You can manage each variation\'s images, downloads, and other details individually.'=>'Ovaj proizvod ima opcije, kao što su veličina ili boja. Slikama, preuzimanjima i drugim detaljima svake varijacije možete upravljati pojedinačno.','This variation will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'Ova varijacija neće pokrenuti kalkulator otpreme vašeg kupca u košarici ili na blagajni. Ovaj proizvod također neće zahtijevati od vaših kupaca da unesu svoje podatke o dostavi na blagajni. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Pročitajte više o virtualnim proizvodima</a>.','%s log file deleted.'=>'%s datoteka dnevnika izbrisana.' . "\0" . '' . "\0" . '','You do not have permission to manage log files.'=>'Nemate dozvolu za upravljanje datotekama zapisnika.','Current'=>'Trenutno','File rotations:'=>'Rotacije datoteka:','Viewing log file %s'=>'Pregled datoteke zapisnika %s','Delete this log file permanently?'=>'Trajno izbrisati ovu datoteku dnevnika?','Return to the file list.'=>'Vratite se na popis datoteka.','Browse log files'=>'Pregledavanje datoteka zapisnika','Select the %1$s log file for %2$s'=>'Odaberite datoteku zapisnika %1$s za %2$s','File size'=>'Veličina datoteke','Date modified'=>'Datum izmjene','Filter by log source'=>'Filtriranje prema izvoru zapisnika','No log files found.'=>'Nisu pronađene datoteke zapisnika.','This file does not exist.'=>'Ova datoteka ne postoji.','Could not access the log file directory.'=>'Nije moguće pristupiti direktoriju datoteka zapisnika.','%1$s was called with an invalid event type "%2$s".'=>'%1$s je pozvan s nevažećom vrstom događaja "%2$s".','Product content not found.'=>'Sadržaj proizvoda nije pronađen.','Data generated by AI for updating dummy products.'=>'Podaci koje generira AI za ažuriranje lažnih proizvoda.','The images for a given store.'=>'Slike za određenu trgovinu.','Invalid business description.'=>'Nevažeći opis tvrtke.','Patterns AI Data'=>'Obrasci AI podataka','Caught exception while enqueuing action "%1$s": %2$s'=>'Uhvaćena iznimka prilikom stavljanja u red čekanja radnje "%1$s": %2$s','e.g. Local pickup'=>'npr. lokalno preuzimanje','Customers will need to spend this amount to get free shipping.'=>'Kupci će morati potrošiti ovaj iznos kako bi dobili besplatnu dostavu.','A minimum order amount AND coupon'=>'Minimalni iznos narudžbe I kupon','A minimum order amount OR coupon'=>'Minimalni iznos narudžbe ILI kupon','No requirement'=>'Nema zahtjeva','Free shipping requires'=>'Potrebna je besplatna dostava','e.g. Free shipping'=>'npr. besplatna dostava','These costs can optionally be added based on the <a target="_blank" href="%s">product shipping class</a>. Learn more about <a target="_blank" href="https://woocommerce.com/document/flat-rate-shipping/#shipping-classes">setting shipping class costs</a>.'=>'Ovi se troškovi po želji mogu dodati na temelju <a target="_blank" href="%s">klase dostave proizvoda</a>. Saznajte više o <a target="_blank" href="https://woocommerce.com/document/flat-rate-shipping/#shipping-classes">postavljanju troškova klase dostave</a>.','e.g. Standard national'=>'npr. standardna nacionalna','Your customers will see the name of this shipping method during checkout.'=>'Vaši će kupci vidjeti naziv ovog načina dostave tijekom naplate.','advanced costs'=>'napredni troškovi','Charge a flat rate per item, or enter a cost formula to charge a percentage based cost or a minimum fee. Learn more about'=>'Naplatite paušalnu cijenu po stavci ili unesite formulu troškova da biste naplatili trošak temeljen na postotku ili minimalnu naknadu. Saznajte više o','Attribute terms.'=>'Atributni pojmovi.','WooCommerce Store Identifier.'=>'Identifikator trgovine WooCommerce.','Add to cart: &ldquo;%s&rdquo;'=>'Dodaj u košaricu: "%s"','An optional zone you can use to set the shipping method(s) available to any regions that have not been listed above.'=>'Neobavezna zona koju možete koristiti za postavljanje načina dostave dostupnih za sve regije koje nisu gore navedene.','Add zone'=>'Dodaj zonu','STEP 1 OF 2'=>'KORAK 1 OD 2','Create shipping method'=>'Kreirajte način dostave','STEP 2 OF 2'=>'KORAK 2 OD 2','Add shipping class costs'=>'Dodavanje troškova klase dostave','Set up %s'=>'Postavljanje %s','Add the shipping methods you\'d like to make available to customers in this zone.'=>'Dodajte načine dostave koje želite učiniti dostupnima korisnicima u ovoj zoni.','List the regions you\'d like to include in your shipping zone. Customers will be matched against these regions.'=>'Navedite regije koje želite uključiti u svoju zonu dostave. Kupci će biti upareni s tim regijama.','Give your zone a name! E.g. Local, or Worldwide.'=>'Dajte svojoj zoni ime! Npr. lokalno ili širom svijeta.','e.g. For heavy items requiring higher postage'=>