merce stranica','block descriptionDisplay the items purchased and order totals.'=>'Prikažite kupljene stavke i ukupne iznose narudžbi.','block titleOrder Totals'=>'Ukupni ukupni brojevi narudžbi','block descriptionDisplay the order details section.'=>'Prikažite odjeljak s pojedinostima narudžbe.','block titleOrder Totals Section'=>'Odjeljak Ukupni brojevi narudžbi','block descriptionDisplay the order summary on the order confirmation page.'=>'Prikažite sažetak narudžbe na stranici za potvrdu narudžbe.','block descriptionDisplay a "thank you" message, or a sentence regarding the current order status.'=>'Prikažite poruku zahvale ili rečenicu koja se odnosi na trenutačni status narudžbe.','block titleOrder Status'=>'Status narudžbe','block descriptionDisplay the order confirmation shipping section.'=>'Prikažite odjeljak za otpremu potvrde narudžbe.','block titleShipping Address Section'=>'Odjeljak Adresa za dostavu','block descriptionDisplay the order confirmation shipping address.'=>'Prikažite adresu za dostavu potvrde narudžbe.','block descriptionDisplay links to purchased downloads.'=>'Prikažite veze na kupljena preuzimanja.','block titleOrder Downloads'=>'Naručite preuzimanja','block descriptionDisplay the downloadable products section.'=>'Prikažite odjeljak s proizvodima za preuzimanje.','block titleDownloads Section'=>'Odjeljak za preuzimanja','block descriptionDisplay the order confirmation billing section.'=>'Prikažite odjeljak za naplatu potvrde narudžbe.','block titleBilling Address Section'=>'Odjeljak Adresa za naplatu','block descriptionDisplay the order confirmation billing address.'=>'Prikažite adresu za naplatu potvrde narudžbe.','block descriptionDisplays additional information provided by third-party extensions for the current order.'=>'Prikazuje dodatne informacije koje pružaju proširenja trećih strana za trenutnu narudžbu.','block titleAdditional Information'=>'Dodatne informacije','block descriptionRenders classic WooCommerce shortcodes.'=>'Prikazuje klasične WooCommerce kratke kodove.','block titleClassic Shortcode'=>'Klasični kratki kod','block keyworddownloads'=>'preuzimanja','block descriptionThe product downloads.'=>'Proizvod se preuzima.','block titleProduct downloads'=>'Preuzimanja proizvoda','block keywordtext'=>'tekst','block descriptionA text field for use in the product editor.'=>'Tekstno polje za upotrebu u uređivaču proizvoda.','block titleProduct text field'=>'Tekstualno polje proizvoda','block keywordnumber'=>'broj','block descriptionA reusable number field for the product editor.'=>'Brojčano polje za višekratnu upotrebu za uređivač proizvoda.','block titleProduct number control'=>'Kontrola broja proizvoda','block descriptionA reusable checkbox for the product editor.'=>'Potvrdni okvir za višekratnu upotrebu za uređivač proizvoda.','days'=>'dana','View all'=>'Vidi sve','Themes'=>'Teme','Search results'=>'Rezultati pretraživanja','Background sync is enabled.'=>'Sinkronizacija u pozadini je omogućena.','Add and manage attributes used for product options, such as size and color.'=>'Dodajte atribute koji se upotrebljavaju za opcije proizvoda i upravljajte njima, kao što su veličina i boja.','This product requires shipping or pickup'=>'Ovaj proizvod zahtijeva dostavu ili preuzimanje','This variation requires shipping or pickup'=>'Ova varijanta zahtijeva dostavu ili preuzimanje','Same as main product'=>'Isto kao i glavni proizvod','Add any files you\'d like to make available for the customer to download after purchasing, such as instructions or warranty info.'=>'Dodajte sve datoteke koje želite učiniti dostupnima korisniku za preuzimanje nakon kupnje, kao što su upute ili podaci o jamstvu.','Variation details'=>'Pojedinosti o varijaciji','<strong>You’re editing details specific to this variation.</strong> Some information, like description and images, will be inherited from the main product, <noticeLink><parentProductName/></noticeLink>.'=>'<strong>Uređujete detalje spec