ain later.'=>'Povezivanje s krajnjom točkom umjetne inteligencije nije uspjelo: pokušajte ponovno kasnije.','Placeholder image used to represent products being showcased under the social media icons. 4 out of 4.'=>'Rezervirano mjesto za sliku koja se koristi za predstavljanje proizvoda koji se prikazuju pod ikonama društvenih medija. 4 od 4.','Placeholder image used to represent products being showcased under the social media icons. 3 out of 4.'=>'Rezervirano mjesto za sliku koja se koristi za predstavljanje proizvoda koji se prikazuju pod ikonama društvenih medija. 3 od 4.','Placeholder image used to represent products being showcased under the social media icons. 2 out of 4.'=>'Rezervirano mjesto za sliku koja se koristi za predstavljanje proizvoda koji se prikazuju pod ikonama društvenih medija. 2 od 4.','Placeholder image used to represent products being showcased under the social media icons. 1 out of 4.'=>'Rezervirano mjesto za sliku koja se koristi za predstavljanje proizvoda koji se prikazuju pod ikonama društvenih medija. 1 od 4.','Placeholder image used to represent a product being showcased.'=>'Slika rezerviranog mjesta koja se koristi za predstavljanje proizvoda koji se izlaže.','Learn about new products and discounts'=>'Saznajte više o novim proizvodima i popustima','Attribute term.'=>'Atributni pojam.','Limit result set to products with specified attributes.'=>'Ograničite skup rezultata na proizvode s navedenim atributima.','Default values for generated variations.'=>'Zadane vrijednosti za generirane varijacije.','Page where shoppers go to finalize their purchase'=>'Stranica na koju kupci idu kako bi dovršili kupnju','Page where shoppers review their shopping cart'=>'Stranica na kojoj kupci pregledavaju svoju košaricu','Legacy'=>'Nasljeđe','⚠️ The WooCommerce Legacy REST API has been removed from WooCommerce, this will cause <a href="%1$s">webhooks on this site that are configured to use the Legacy REST API</a> to stop working. <a target="_blank" href=