direct/X-Sendfile method. A Force Download will be used instead.'=>'%1$s nije bilo moguće poslužiti metodom X-Accel-Redirect/X-Sendfile. Umjesto toga koristit će se prisilno preuzimanje.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Ako je metoda preuzimanja "Prislino preuzimanje" ili "X-Accel-Redirect/X-Sendfile" odabrana, ali ne radi, sustav će koristiti metodu "Preusmjeravanje" kao posljednje sredstvo. <a href="%1$s">Pogledajte ovaj vodič</a> za više pojedinosti.','Allow using redirect mode (insecure) as a last resort'=>'Dopusti korištenje načina preusmjeravanja (nesiguran) kao zadnjeg rješenja','Task Options'=>'Opcije zadatka','Set your store location and where you\'ll ship to.'=>'Postavite lokaciju svoje trgovine i mjesto na koje ćete slati.','Choose payment providers and enable payment methods at checkout.'=>'Odaberite pružatelje usluga plaćanja i omogućite načine plaćanja na blagajni.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Samo ste jedan korak do isplate. Potvrdite svoje poslovne podatke kako biste počeli upravljati transakcijama s WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Započnite dodavanjem prvog proizvoda u svoju trgovinu. Svoje proizvode možete dodati ručno, putem CSV-a ili ih uvesti s druge usluge.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Adresa vaše trgovine potrebna je za postavljanje zemlje podrijetla za dostavu, valute i opcije plaćanja.','Set your store location and configure tax rate settings.'=>'Postavite lokaciju svoje trgovine i konfigurirajte postavke porezne stope.','Grow your store'=>'Razvijte svoju trgovinu'