ress Dashboard. Only with WooPayments.'=>'Upravljajte transakcijama bez napuštanja WordPress nadzorne ploče. Samo uz WooPayments.','Create and send purchase follow-up emails, newsletters, and promotional campaigns straight from your dashboard.'=>'Izradite i pošaljite e-poruke za praćenje kupovine, biltene i promotivne kampanje izravno sa svoje nadzorne ploče.','Invalid path provided.'=>'Navedena je neispravna putanja.','How easy was it to add a product tag?'=>'Кoliko је bilo lаko dodati oznaku proizvoda?','A link to a product.'=>'Poveznica na proizvod. ','Product Link'=>'Poveznica na proizvod','A link to a product tag.'=>'Poveznica na oznaku proizvoda.','Product Tag Link'=>'Poveznica oznake proizvoda','A link to a product category.'=>'Poveznica na kategoriju proizvoda. ','Product Category Link'=>'Poveznica kategorije proizvoda ','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Kako biste osigurali da obavijesti vaše trgovine stižu do inboxa vas i vaših kupaca, preporučujemo da svoju adresu e-pošte povežete s domenom i postavite namjenski SMTP poslužitelj. Ako se čini da se nešto ne šalje ispravno, instalirajte <a href="%1$s">WP Mail Logging Plugin</a> ili provjerite <a href="%2$s">stranicu s često postavljanim pitanjima o e-pošti</a>.','Delta Amacuro'=>'Delta Amacuro','Federal Dependencies'=>'Federal Dependencies','Zulia'=>'Zulia','Yaracuy'=>'Yaracuy','Trujillo'=>'Trujillo','Táchira'=>'Táchira','Sucre'=>'Sucre','Portuguesa'=>'Portuguesa','Nueva Esparta'=>'Nueva Esparta','Monagas'=>'Monagas','Miranda'=>'Miranda','Mérida'=>'Mérida','Lara'=>'Lara','Guárico'=>'Guárico','Falcón'=>'Falcón','Cojedes'=>'Cojedes','Carabobo'=>'Carabobo','Bolívar'=>'Bolívar','Barinas'=>'Barinas