ts provided using the smallest unit of the currency.'=>'Ukupni iznosi osigurani korištenjem najmanje jedinice valute.','The coupons unique code.'=>'Jedinstveni kod kupona.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'URL za preusmjeravanje kupca nakon odjave. To bi mogla biti, na primjer, poveznica do web stranice obrađivača plaćanja.','An array of data being returned from the payment gateway.'=>'Niz podataka koji se vraćaju od payment gateway.','Status of the payment returned by the gateway. One of success, pending, failure, error.'=>'Status plaćanja koji je payment gateway. Jedan za uspjeh, čekanje, neuspjeh, greška.','The ID of the payment method being used to process the payment.'=>'ID načina plaćanja koji se koristi za obradu plaćanja.','Customer ID if registered. Will return 0 for guests.'=>'ID kupca ako je registriran. Vratit će 0 za goste.','Note added to the order by the customer during checkout.'=>'Napomena koju je kupac dodao prilikom narudžbe.','Order key used to check validity or protect access to certain order data.'=>'Tipka za narudžbu koja se koristi za provjeru valjanosti ili zaštitu pristupa određenim podacima narudžbe.','Order status. Payment providers will update this value after payment.'=>'Stanje narudžbe. Davatelji plaćanja ažurirat će ovu vrijednost nakon uplate.','The order ID to process during checkout.'=>'ID narudžbe za obradu tokom plaćanja.','Parent term ID, if applicable.'=>'Matični ID, ako je primjenjivo.','Quantity left in stock if stock is low, or null if not applicable.'=>'Količina ostavljena na zalihi ako je zaliha mala, ili nula ako nije primjenjiva.','List of variation IDs, if applicable.'=>'Popis ID-ova varijacije, ako je primjenjivo.','Price string formatted as HTML.'=>'Niz cijena oblikovan kao HTML.','Price data provided using the smallest unit of the currency.'=>'Podaci o cijenama dobijeni s najmanjom jedinicom valute.','Product full description in H