xists or is invalid.'=>'Artikal u košarici više ne postoji ili nije važeći.','Unique identifier (key) for the cart item.'=>'Jedinstveni identifikator (ključ) za košaricu.','If true, empty terms will not be returned.'=>'Ako je istina, prazni izrazi se neće vratiti.','Sort by term property.'=>'Poredaj po svojstvu termina.','Sort ascending or descending.'=>'Poredaj uzlazno ili silazno.','Coupon does not exist in the cart.'=>'Kupon ne postoji u košarici.','Coupon cannot be removed because it is not already applied to the cart.'=>'Kupon se ne može ukloniti jer nije već primijenjen u košarici.','Invalid coupon code.'=>'Nevažeći kod kupona.','Coupons are disabled.'=>'Kuponi su onemogućeni.','Unique identifier for the coupon within the cart.'=>'Jedinstveni identifikator kupona u košarici.','ISO code for the country of the address being shipped to.'=>'ISO kod za zemlju adrese na koju se šalje.','Zip or Postcode of the address being shipped to.'=>'Poštanski broj adrese na koju se šalje.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'ISO kod, ili naziv, za državu, pokrajinu ili distrikt adrese do koje se šalje.','City of the address being shipped to.'=>'Grad adrese na koju se dostavlja.','Second line of the address being shipped to.'=>'Drugi red adrese na koju se šalje.','First line of the address being shipped to.'=>'Prva red adrese na koju se šalje.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Ograniči grupu rezultata na proizvode temeljene na maksimalnoj cijeni, pod uvjetom da se koristi najmanja jedinica valute.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Ograniči grupu rezultata na proizvode temeljene na minimalnoj cijeni, pod uvjetom da se koristi najmanja jedinica valute.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Maksimalni broj artikala koji se vraćaju u grupi rezultata. Ako je prazno korisit se izvorno neograničeno.','Invalid category ID.'=>'Nevažeći ID kategorije.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Kreiranje WooCommerce tablice %1$s nije uspjelo. Ima li korisnik %2$s KREIRAJ povlastice u bazi podataka %3$s?','Verifying database... One or more tables are still missing: '=>'Provjera baze podataka ... Još uvijek nedostaju jedna ili više tablica:','Database verified successfully.'=>'Baza podataka uspješno je provjerena.','You need WooCommerce 4.2 or newer to run this tool.'=>'Za pokretanje ovog alata potreban vam je WooCommerce 4.2 ili noviji.','The active version of WooCommerce does not support template cache clearing.'=>'Aktivna inačica WooCommercea ne podržava brisanje predmemorije predloška.','Template cache cleared.'=>'Predmemorija predloška obrisana.','Verify if all base database tables are present.'=>'Provjera jesu li sve osnovne tablice baze podataka prisutne.','Verify database'=>'Verificiraj bazu podataka','Verify base database tables'=>'Verificiraj tablice baze podataka','This tool will empty the template cache.'=>'Ovaj alat će očistiti predmemoriju predložaka.','Clear template cache'=>'Očisti predmemoriju predložaka','Collect and validate EU VAT numbers at checkout'=>'Skupite i provjerite EU VAT brojeve na checkoutu','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Ako je vaša trgovina locirana u EU, preporučujemo korištenje EU VAT Number ekstenzije uz automatske poreze. U checkoutu ponuditi će polje za upis i provjeru kupčevog EU VAT broja, ako ga ima.','Get real-time order alerts anywhere'=>'Dobijte obavijesti o narudžbama u realnom vremenu svugdje.','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Dobijte obavijesti o aktivnostima trgovine, uključujući nove narudžbe i recenzije proizvoda direktno na vaše mobilne uređaje s Woo aplikacijom.','First order received'=>'Primljena je prva narudžba','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Ovaj video tutorijal pomoći će vam u procesu dodavanja vašeg prvog proizvoda u WooCommerce.','Do you need help with adding your first product?'=>'Trebate li pomoć s dodavanjem vašeg prvog proizvoda?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Pokretanje modne web-stranice je uzbudljivo ali može se činiti nadmoćno neodoljiv. U ovom članku provesti ćemo vas kroz proces postavljanjam naučiti vas kako napraviti uspješne liste proizvoda, i pokazati kako se marketinški promovirati pred vašim idealnim kupcima.','Start your online clothing store'=>'Započnite online trgovinu s odjećom','The admin note layout has a wrong prop value.'=>'Admin izgled bilješki ima pogrešnu prop vrijednost.','Watch tutorial'=>'Pogledaj tutorijal','Share feedback'=>'Podijeli povratne informacije','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Sad kada ste nas odabrali kao partnera, naš cilj je pobrinuti se da vam pružamo ispravne alate koji ispunjavaju vaše potrebe. Veselimo se vašim povratnim informacijama o iskustvu postavljanja trgovine kako bi ga poboljšali u budućnosti.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Mijenjanje eCommerce platforme može se činiti kao velika prepreka, ali je lakše nego što mislite preseliti vaše proizvode, kupce i narudžbe u WooCommerce. Ovaj članak pomoći će vam u tom procesu.','Do you want to migrate from Shopify to WooCommerce?'=>'Želite li migrirati s Shopify u WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce Subscriptions omogućuju vam da ponudite brojne pretplate za fizičke ili virtualne proizvode i usluge. Kreirajte proizvod-mjeseca klubove, pretplate za tjedne usluge ili čak pakete za godišnju naplatu softvera. Dodajte naknadu za upis, ponudite besplatne periode, ili postavite ograničene vremenske periode.','Do you need more info about WooCommerce Subscriptions?'=>'Trebate li više informacija o WooCommerce Subscriptions?','There was a problem activating some of the requested plugins.'=>'Dogodio se problem s aktiviranjem nekih traženih dodataka.','Plugins were successfully activated.'=>'Dodatci su uspješno aktivirani.','The requested plugin `%s`. is not yet installed.'=>'Traženi dodatak `%s` još nije instaliran.','There was a problem installing some of the requested plugins.'=>'Dogodio se problem s instaliranjem nekih traženih dodataka.','Plugins were successfully installed.'=>'Dodatci su uspješno instalirani.','The requested plugin `%s` could not be installed. Upgrader install failed.'=>'Traženi dodatak `%s` nije moguće instalirati. Instalacija ažuriranja nije uspjela.','Plugins must be a non-empty array.'=>'Dodatak mora biti non-empty array.','Registers whether the note is deleted or not'=>'Registrira je li bilješka obrisana ili nije.','The image of the note, if any.'=>'Slika bilješke, ako postoji.','The layout of the note (e.g. banner, thumbnai