ired for WooCommerce to function are missing, some features may not work as expected. Missing tables: %1$s. <a href="%2$s">Check again.</a>'=>'Jedna ili više tablica potrebnih za funkcioniranje WooCommercea nedostaju, neke značajke možda neće raditi kako se očekuje. Nedostaju tablice: %1$s. <a href="%2$s"> Provjerite ponovo.</a>','Database tables missing'=>'Nedostaju tablice baze podataka','Missing base tables: %s. Some WooCommerce functionality may not work as expected.'=>'Nedostaju osnovne tablice :%s. Neke WooCommerce funkcije možda neće raditi kako se očekuje.','Home'=>'Početna','Marketplace'=>'Tržište','Overview'=>'Pregled','Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.'=>'Preuzimajte plaćanja kod pružatelja koji vam odgovara - odaberite između 100 i više platnih oblika za WooCommerce.','Start accepting payments on your store!'=>'Počnite prihvaćati plaćanja u svojoj trgovini!','Install plugins'=>'Instalirajte dodatke','Uh oh... There was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again.'=>'Ups... Dogodila se greška prilikom instalacija Jetpack i WooCommerce Shipping & Tax. Molimo pokušajte kasnije.','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Primijećena je greška prilikom instalacije Jetpack i WooCommerce Shipping & Tax. Molimo pokušajte kasnije i uživajte u prednostima dodataka spojenih na vašu trgovinu! Ispričavamo se na neugodnosti. "Jetpack" i "WooCommerce Shipping & Tax" dodaci će biti instalirani i aktivirani besplatno.','User&#8217;s WooCommerce payment tokens data.'=>'Podaci o tokenima za plaćanje korisnika&#8217; s WooCommerce-a.','User&#8217;s WooCommerce access to purchased downloads dat