ona','Please visit the <a href="%s" target="_blank">subscriptions page</a> and renew to continue receiving updates.'=>'Posjetite <a href="%s" target="_blank">stranicu pretplate</a> i obnovite da biste nastavili primati ažuriranja.','WooCommerce.com support'=>'WooCommerce.com podrška','For further assistance with WooCommerce core, use the <a href="%1$s">community forum</a>. For help with premium extensions sold on WooCommerce.com, <a href="%2$s">open a support request at WooCommerce.com</a>.'=>'Za dodatnu pomoć oko WooCommerce jezgre, koristite <a href="%1$s">forum zajednice</a>. Za pomoć oko premium proširenja koja se prodaju na WooCommerce.com, <a href="%2$s">otvorite zahtjev za podršku na WooCommerce.com</a>.','Installed version not tested with active version of WooCommerce %s'=>'Instalirana verzija nije testirana s aktivnom verzijom WooCommerce %s','%1$s (update to version %2$s is available)'=>'%1$s (dostupno je ažuriranje na verziju %2$s)','Visit WooCommerce.com to learn more about <a href="%1$s" target="_blank">getting started</a>.'=>'Posjetite WooCommerce.com da biste saznali više o <a href="%1$s" target="_blank">početku rada</a>.','The plugin could not be activated.'=>'Dodatak nije moguće aktivirati.','Limit stats fields to the specified items.'=>'Ograničite polja statistike na navedene stavke.','Name of other platform used to sell (not listed).'=>'Naziv druge platforme koja se koristi za prodaju (nije na popisu).','There was an error communicating with the WooPayments plugin.'=>'Došlo je do greške prilikom komunikacije s dodatkom WooPayments.','Shipping Label'=>'Oznaka za dostavu','Personalize homepage'=>'Personaliziraj početnu stranicu','Personalize your store\'s homepage'=>'Personaliziraj početnu stranicu svoje trgovine','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Početna stranica jedna je od najvažnijih ulaznih točaka u vašoj trgovini. Ako se napravi ispravno, to može dovesti do većih konverzija i angažmana. Ne zaboravite personalizirati početnu stranicu koju smo stvorili za vašu trgovinu tijekom ukrcaja.','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.'=>'Sigurno prihvaćajte kreditne i debitne kartice na svojoj web lokaciji. Upravljajte transakcijama bez napuštanja svoje WordPress nadzorne ploče. Samo uz <strong> WooPayments </strong>.','Try the new way to get paid'=>'Isprobajte novi način plaćanja','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Izgleda da su nedostajale jedna ili više tablica baze podataka. Pokušaj ponovnog stvaranja nedostajuće tablice.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Vaša je trgovina konfigurirana za posluživanje digitalnih proizvoda pomoću metode "Samo preusmjeravanje". Ova metoda je zastarjela, <a href="%s"> umjesto toga prebacite se na drugu metodu.</a> <br><em>Ako koristite udaljeni poslužitelj za datoteke za preuzimanje (kao što su Google Drive, Dropbox, Amazon S3), možete opcionalno "dozvoliti korištenje preusmjeravanja kao zadnju opciju". Odabirom te opcije i/ili bilo koju druge opcije ova obavijest biti će uklonjena. </em>','Choose theme'=>'Odaberite temu','Get started'=>'Započni','Mobile app'=>'Mobilna aplikacija','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Pošaljite ciljane kampanje, oporavite napušte