ead more%3$s about what data we collect.'=>'Prikupljanje podataka o upotrebi omogućava nam poboljšanje usluge WooCommerce. Vaša će se trgovina uzimati u obzir dok procjenjujemo nove karakteristike, prosuđujemo kvalitetu ažuriranja ili utvrdimo ima li neko poboljšanje smisla. Uvijek možete posjetiti %1$sPostavke%3$s i odabrati da zaustavite dijeljenje podataka. %2$sPročitajte još%3$s o tome koje podatke prikupljamo.','The admin note action label prop cannot be empty.'=>'Svojstvo oznake za administrativnu bilješku ne može biti prazno.','The admin note action name prop cannot be empty.'=>'Svojstvo naziva radnje administrativne bilješke ne može biti prazno.','The admin note date prop cannot be empty.'=>'Svojstvo datuma administrativne bilješke ne može biti prazno.','The admin note source prop cannot be empty.'=>'Svojstvo izvora administrativne bilješke ne može biti prazno.','The admin note status prop (%s) is not one of the supported statuses.'=>'Svojstvo statusa (%s) administrativne bilješke nije jedan od podržanih statusa.','The admin note status prop cannot be empty.'=>'Svojstvo statusa administrativne bilješke ne može biti prazno.','The admin note content_data prop must be an instance of stdClass.'=>'Admin bilješka content_data prop mora biti instanca stdClass.','The admin note content prop cannot be empty.'=>'Svojstvo sadržaja administrativne bilješke ne može biti prazno.','The admin note title prop cannot be empty.'=>'Svojstvo naslova administrativne bilješke ne može biti prazno.','The admin note locale prop cannot be empty.'=>'Lokalno svojstvo administrativne bilješke ne može biti prazno.','The admin note type prop (%s) is not one of the supported types.'=>'Tip svojstva administrativne bilješke (%s) nije jedan od podržanih tipova.','The admin note type prop cannot be empty.'=>'Svojstvo za tip administrativne bilješke ne može biti prazno.','The admin note name prop cannot be empty.'=>' Svojstvo za ime administrativne bilješke ne može biti prazno.','Add a product'=