ue for select or count parameter. Cannot query actions.'=>'Nevažeća vrijednost za parametar odabira ili brojanja. Radnje nije moguće ispitati.','Database error.'=>'Greška s bazom podataka','%s Support for strings longer than this will be removed in a future version.'=>'%s Podrška za stringove dulje od ovog biti će uklonjena u nekoj budućoj verziji.','ActionScheduler_Action::$args too long. To ensure the args column can be indexed, action args should not be more than %d characters when encoded as JSON.'=>'ActionScheduler_Action::$ je predugo. Kako bi se osiguralo da se argumenti stupca mogu indeksirati, argumenti akcije ne bi trebali biti veći od %d znakova kada su kodirani kao JSON.','There was a failure scheduling the next instance of this action: %s'=>'Neuspješno zakazivanja sljedeće instance ove akcije:%s','There was a failure fetching this action: %s'=>'Neuspješno dohvaćanja ove akcije: %s','action ignored via %s'=>'akcija zanemarena putem %s','action failed via %1$s: %2$s'=>'akcija nije uspjela putem %1$s: %2$s','action complete via %s'=>'akcija dovršena putem %s','action started via %s'=>'akcija započeta preko %s','Action [%1$s] has an invalid schedule: %2$s'=>'Akcija [%1$s] ima nevažeći raspored: %2$s','Activity log for the action.'=>'Dnevnik aktivnosti za akciju.','The date/time the action is/was scheduled to run.'=>'Datum/vrijeme kada je akcija (bila) zakazana da se pokrene.','Scheduled'=>'Tempirano','The action\'s schedule frequency.'=>'Učestalost rasporeda akcije','Optional action group.'=>'Neobavezna akcijska grupa.','Optional data array passed to the action hook.'=>'Neobvezni niz podataka prešao je u akcijsku kuku.','Action statuses are Pending, Complete, Canceled, Failed'=>'Statusi akcije su U toku, Završeni, Otkazani, Propali','Name of the action hook that will be triggered.'=>'Naziv akcijske kuke koja će se aktivirati.','Scheduled Action Columns'=>'Stupac Zakazane akcije','Action Scheduler is a scalable, traceable job queue for background processing 