rekna plaćanja na email adresu:','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Sigurno prihvatite kreditne i debitne kartice uz jednu nisku stopu, bez iznenađenja (po dogovorenim cijenama). Online prodaja na mreži i u fizičkoj trgovini uz praćenje prodaje i inventara na jednom mjestu. <a href="%s" target="_blank"> Saznajte više o Square servisu </a>.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Odaberite plaćanje koje želite, platite odmah, platite kasnije ili na rate. Nema brojeva kreditnih kartica, bez zaporki, bez brige. <a href="%s" target="_blank"> Saznajte više o Klarni </a>.','Full checkout experience with pay now, pay later and slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Potpuno checkout iskustvo.Platiti odmah, kasnije i na rate. Nema brojeva kreditnih kartica, bez zaporki, bez brige. <a href="%s" target="_blank"> Saznajte više o Klarni </a>.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Prihvatite debitne i kreditne kartice u više od 135 valuta, metode poput Alipay i jednokratnu naplatu s Apple Payom. <a href="%s" target="_blank"> Saznajte više </a>.','I will also be selling products or services in person.'=>'Također ću osobno prodavati proizvode ili usluge.','Customer downloads'=>'Preuzimanja kupca','Revision restored.'=>'Revizija je obnovljena.','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'Ako želite, ovdje možete unijeti prilagođenu strukturu za URL-ove proizvoda. Na primjer, koristeći <code> trgovina </code>, veza proizvoda bi izgledala <code>%strgovina/primjer-proizvoda/ </code>. Ova postavka utječe samo na URL-ove proizvoda, a ne na ostalo poput kategorije proizvoda.','Move &#8220;%s&#8221; to the Trash'=>'Premjesti &#8220;%s&#8221; u Smeće','Attributes let you define extra product data, such as size or color. You can use these attributes in the shop sidebar using the "layered nav" widgets.'=>'Atributi vam omogućuju definiranje dodatnih podataka o proizvodu, kao što su veličina ili boja. Te atribute možete upotrebljavati na bočnoj traci trgovine pomoću widgeta "slojevita navigacija".','Determines how this attribute\'s values are displayed.'=>'Određuje prikaz vrijednosti ovih atributa.','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'Ovaj proizvod je prodavan i može biti povezan s postojećim narudžbama. Jeste li sigurni da ga želite izbrisati?','Read more about &ldquo;%s&rdquo;'=>'Pročitaj više o &ldquo;%s&rdquo;','Simiyu'=>'Simiyu','Njombe'=>'Njombe','Katavi'=>'Katavi','Geita'=>'Geita','Manyara'=>'Manyara','Tanga'=>'Tanga','Tabora'=>'Tabora','Singida'=>'Singida','Shinyanga'=>'Shinyanga','Ruvuma'=>'Ruvuma','Rukwa'=>'Rukwa','Coast'=>'Coast','Mwanza'=>'Mwanza','Mtwara'=>'Mtwara','Morogoro'=>'Morogoro','Zanzibar West'=>'Zanzibar Zapad','Mbeya'=>'Mbeya','Mara'=>'Mara','Lindi'=>'Lindi','Zanzibar South'=>'Zanzibar Jug','Pemba South'=>'Pemba Jug','Kilimanjaro'=>'Kilimanjaro','Kigoma'=>'Kigoma','Zanzibar North'=>'Zanzibar Sjever','Pemba North'=>'Pemba Sjever','Kagera'=>'Kagera','Iringa'=>'Iringa','Dodoma'=>'Dodoma','Dar es Salaam'=>'Dar es Salaam','Arusha'=>'Arusha','Ungheni'=>'Ungheni','Taraclia'=>'Taraclia','Soroca'=>'Soroca','Rezina'=>'Rezina','Orhei'=>'Orhei','Nisporeni'=>'Nisporeni','Leova'=>'Leova','Ialoveni'=>'Ialoveni','Glodeni'=>'G