yment gateway.'=>'Neispravni payment gateway.','Sorry, this coupon is not applicable to selected products.'=>'Nažalost, ovaj kupon nije primjenjiv na odabrane proizvode.','Invalid discount amount'=>'Neispravni iznos popusta','Create account password'=>'Kreiraj lozinku računa','Fee has already been added.'=>'Naknada je već dodana.','%s fee'=>'%s naknada','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'Ova opcija će obrisati SVE vaše porezne stavke, koristite pažljivo. Ova akcija se ne može vratiti.','Delete tax rates'=>'Obriši postotke poreza','Create pages'=>'Kreiraj stranice','Create default WooCommerce pages'=>'Kreiraj izvorne WooCommerce stranice','Clear customer sessions'=>'Očisti razdoblja aktivnosti kupaca','WooCommerce transients'=>'WooCommerce prijelazi (transients)','Page settingTerms and conditions'=>'Odredbe i uvjeti','Post Type Counts'=>'Broj vrste objava','Database Index Size'=>'Indeks veličina baze podataka','Database Data Size'=>'Veličina podataka baze podataka','Total Database Size'=>'Ukupna veličina baze podataka','%s failed. Contact your hosting provider.'=>'%s neuspjelo. Kontaktirajte pružatelja hosting usluga.','Forcing downloads will keep URLs hidden, but some servers may serve large files unreliably. If supported, %1$s / %2$s can be used to serve downloads instead (server requires %3$s).'=>'Forsiranje preuzimanja učiniti će URL-ove skrivenima, ali neki poslužitelji mog isporučiti velike datoteke nepouzdano. Ako je podržano, %1$s / %2$s može se umjesto koristiti za isporuku preuzimanja (poslužitelj zahtjeva %3$s).','The postal code, if any, in which your business is located.'=>'Poštanski broj, ako postoji, mjesta lokacije poduzeća.','The country and state or province, if any, in which your business is located.'=>'Država i pokrajina, ako postoji, mjesta lokacije poduzeća.','Country / State'=>'Zemlja / Država','The city in which your business is located.'=>'Grad u kojem je lokacija poduzeća.','An additional, optional address line for your business location.'=>'Dodatna, neobavezna adresa lokacije vašeg poduzeća.','The street address for your business location.'=>'Adresa (ulica) lokacije vašeg poduzeća.','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Ovo je lokacija vašeg poduzeća. Porezne stope i cijene dostave koristiti će ovu adresu.','Store Address'=>'Adresa trgovine','Update now'=>'Ažuriraj sada','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Navedeni dodaci još nisu deklarirali kompatibilnost s WooCommerce %s, i trebali bi biti ažurirani i pregledani prije nego što nastavite.','Tested up to WooCommerce version'=>'Testirano do WooCommerce inačice','Plugin'=>'Dodatak','unknown'=>'nepoznato','<strong>Heads up!</strong> The versions of the following plugins you\'re running haven\'t been tested with WooCommerce %s. Please update them or confirm compatibility before updating WooCommerce, or you may experience issues:'=>'<strong>Upozorenje!</strong> Inačice navedenih dodataka koje koristite nisu testirane s WooCommerce %s. Ažurirajte ih kako bi potvrdili kompatibilnost prije nadogradnje WooCommercea, u protivnom bi mogli iskusiti poteškoće:','Refund #%1$s - %2$s by %3$s'=>'Povrat novaca #%1$s - %2$s od %3$s','Add shipping'=>'Dodaj dostavu','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'Zaliha nije ažurirana jer se vrijednost promijenila od zadnjeg uređivanja. Proizvod %1$d ima %2$d jedinice u zalihi.','Order details manually sent to customer.'=>'Detalji narudžbe manualno poslani kupcu.','Choose an action...'=>'Odaberite akciju...','Send order details to customer'=>'Pošalji kupcu e-poštom detalje narudžbe','Position'=>'Pozicija','Upload a new file'=>'Prenesi novu datoteku','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'Datoteka je prazna ili koristi drugačiji encoding od UTF8, pokušajte ponovno s novom datotekom.','Lifetime Subscription'=>'Cijelo-životna pretplata','Sort by:'=>'Sortiraj po:','Below is a list of extensions available on your WooCommerce.com account. To receive extension updates please make sure the extension is installed, and its subscription activated and connected to your WooCommerce.com account. Extensions can be activated from the <a href="%s">Plugins</a> screen.'=>'Ispod se nalazi lista ekstenzija dostupnih na vašem WooCommerce.com računu. Kako bi primali ažuriranja ekstenzija pobrinite se da je ekstenzija instalirana i da je pretplata za nju aktivirana i povezana s vašim WooCommerce.com računom. Ekstenzije se mogu aktivirati iz zaslona <a href="%s">Dodaci</a>.','Expired'=>'Isteklo','Expiring Soon'=>'Uskoro ističe','Update Available'=>'Dostupno ažuriranje','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Ako vam se sviđa %1$s ostavite %2$s ocjenu. Unaprijed hvala!','Transfer existing products to your new store — just import a CSV file.'=>'Premjestite postojeće proizvode u vašu novu trgovinu — jednostavno uvezite CSV datoteku.','Import products'=>'Uvezite demo proizvode','Have an existing store?'=>'Imate već postojeću trgovinu?','Create a product'=>'Kreiraj proizvod','Yes please!'=>'Da. Hvala!','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Ovdje smo za vas — dobijte savjete, ažuriranja proizvoda, i inspiraciju izravno u vaš inbox.','You\'re ready to start selling!'=>'Spremni ste za početak prodaje!','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Moguće da je vaša web-stranica na privatnoj mreži. Jetpack se može povezati samo s javnim web-stranicama. Provjerite jeli vaša web-stranica vidljiva na internetu, i zatim pokušajte ponovno povezati 🙏.','Sorry! We couldn\'t contact Jetpack just now 😭. Please make sure that your site is visible over the internet, and that it accepts incoming and outgoing requests via curl. You can also try to connect to Jetpack again, and if you run into any more issues, please contact support.'=>'Nažalost, trenutno nije moguće kontaktirati Jetpack 😭. Provjerite jeli vaša web-stranica vidljiva na internetu, i da prihvaća dolazeće i odlazeće zahtjeve putem curl-a. Možete ponovno pokušati povezati Jetpack, i ako budete imali još problema kontaktirajte našu podršku.','Sorry! We tried, but we couldn\'t install Jetpack for you 😭. Please go to the Plugins tab to install it, and finish setting up your store.'=>'Nažalost, nije uspjela instalacija Jetpacka 😭. Otvorite karticu Dodaci kako bi ga instalirali i dovršili postavljanje trgovine.','Sorry! We tried, but we couldn\'t connect Jetpack just now 😭. Please go to the Plugins tab to connect Jetpack, so that you can finish setting up your store.'=>'Nažalost, trenutno nije moguće spojiti Jetpack 😭. Otvorite karticu Dodaci kako bi spojili Jetpack i dovršili postavljanje trgovine.','Share new items on social media the moment they\'re live in your store.'=>'Podijelite nove stavke na društvenim mrežama istog trenutka kada postanu dostupni u trgovini.','Product promotion'=>'Promocija proizvoda','Get an alert if your store is down for even a few minutes.'=>'Dobijte upozorenje ako vaša trgovina bude nedostupna čak i par minuta.','Store monitoring'=>'Nadzor trgovine','Get insights on how your store is doing, including total sales, top products, and more.'=>'Dobijte uvid kako vaša trgovina radi, uključujući ukupnu prodaju, top proizvode, i još više.','Store stats'=>'Statistika trgovine','Protect your store from unauthorized access.'=>'Zaštitite trgovinu od neovlaštenog pristupa.','Better security'=>'Bolja sigurnost','Bonus reasons you\'ll love Jetpack'=>'Bonus razlozi zašto ćete voljeti Jetpack','By connecting your site you agree to