urred when deactivating the subscription for %s. Please try again later.'=>'Dogodila se greška pri deaktivaciji pretplate za %s. Pokušajte ponovno kasnije.','Subscription for %1$s deactivated successfully. You will no longer receive updates for this product. <a href="%2$s">Click here</a> if you wish to deactivate the plugin as well.'=>'Uspješno deaktivirana pretplata za %1$s. Više nećete primati ažuriranja za ovaj proizvod. <a href="%2$s">Kliknite ovdje</a> ako također želite deaktivirati dodatak.','Subscription for %s deactivated successfully. You will no longer receive updates for this product.'=>'Uspješno deaktivirana pretplata za %s. Više nećete primati ažuriranja za ovaj proizvod.','An error has occurred when activating %s. Please try again later.'=>'Dogodila se greška pri deaktivaciji %s. Pokušajte ponovno kasnije.','%s activated successfully. You will now receive updates for this product.'=>'%s je uspješno aktiviran! Primat ćete ažuriranja za ovaj proizvod.','Version %s is <strong>available</strong>. To enable this update you need to <strong>purchase</strong> a new subscription.'=>'Inačica %s je <strong>dostupna</strong> za preuzimanje. Kako biste omogućili ovo ažuriranje, morati ćete <strong>kupiti</strong> novu pretplatu.','This subscription is expiring soon. Please <strong>renew</strong> to continue receiving updates and support.'=>'Ova pretplata uskoro ističe. <strong>Obnovite</strong>  pretplatu kako bi nastavili primati ažuriranja i podršku.','Enable auto-renew'=>'Omogući automatsko obnavljanje','Subscription is <strong>expiring</strong> soon.'=>'Pretplata uskoro <strong>ističe</strong>.','Renew'=>'Obnovi','This subscription has expired. Please <strong>renew</strong> to receive updates and support.'=>'Ova pretplata je istekla. <strong>Obnovite</strong> pretplatu kako bi nastavili primati ažuriranja i podršku.','This subscription has expired. Contact the owner to <strong>renew</strong> the subscription to receive updates and support.'=>'Ova pretplata je 